import React from 'react'

const MovieRow = (props) => {

    return (
        <div>
            <div className='row--header'>
                <div id={props.list.slug} key={props.list.slug}>
                    <span>{props.movie.title}</span>
                    <div className='row--imgs' >
                        {props.movie.items.results.map(movie => <img key={movie.id} className='movie--poster' src={`https://image.tmdb.org/t/p/w300${movie.poster_path}`} ></img>)}
                    </div>

                </div>
            </div>
        </div>
    )
}

export default MovieRow;
